            public struct Genericos
            {
                public static void RegistraBlockScript(string Key, string ScriptStament)
                {
                    ((System.Web.UI.Page)HttpContext.Current.Handler).RegisterClientScriptBlock(Key, "<script>\n" + ScriptStament + "\n" + "</script>");
                }
                public static void RegistraBlockScriptLiteral(string ScriptStament)
                {
                    ((System.Web.UI.Page)HttpContext.Current.Handler).Controls.Add(new LiteralControl("<script>\n" + ScriptStament + "\n" + "</script>\n"));
                }
                public static void SubirArchivo(string RutaYNombreAcrhivo, byte[] ArchivoBonary)
                {
                    System.IO.FileStream newFile = new System.IO.FileStream(RutaYNombreAcrhivo, FileMode.Create);
                    newFile.Write(ArchivoBonary, 0, ArchivoBonary.Length);
                    newFile.Close();

                }

                private static void WriteToFile(string strPath, ref byte[] Buffer)
                {
                    System.IO.FileStream newFile = new System.IO.FileStream(strPath, FileMode.Create);
                    newFile.Write(Buffer, 0, Buffer.Length);
                    newFile.Close();
                }

                public static void UploadProcessRequest(HttpContext context)
                {
                    // para framentar el archivo: https://www.c-sharpcorner.com/article/understanding-multithreading-and-multitasking-in-c-sharp/
                    char bs = EasyControlWeb.EasyUtilitario.Constantes.Caracteres.BackSlash;
                    string PathLocal = context.Request.Params["PathLocal"];
                    PathLocal = PathLocal.Replace('.', bs);
                    PathLocal = PathLocal.Substring(1, PathLocal.Length - 1);

                    string PilaResponse = "";

                    context.Response.Buffer = true;
                    context.Response.Clear();

                    context.Response.ContentType = "text/plain";
                    //context.Response.ContentType = "text/html";
                    var writer = new StringWriter();
                    foreach (string ArchivoName in context.Request.Files)
                    {
                        HttpPostedFile file = context.Request.Files[ArchivoName];
                        int nFileLen = file.ContentLength;
                        byte[] myData = new byte[nFileLen];
                        file.InputStream.Read(myData, 0, nFileLen);
                        WriteToFile(PathLocal + file.FileName, ref myData);
                        PilaResponse += ArchivoName + "@";
                        //Al finalizar la carga
                    }
                    PilaResponse = PilaResponse.Substring(0, PilaResponse.Length - 1);
                    context.Response.Write(PilaResponse);
                    context.Response.Flush();
                    context.Response.End();
                }

                public static void EnviarEmail(string From,string to,string Asunto,string Mensaje,string RutaFileAttach) {
                    
                        try
                        {
                            MailMessage correo = new MailMessage();
                            SmtpClient smtp = new SmtpClient();

                            correo.From = new MailAddress(From, "", System.Text.Encoding.UTF8);
                            correo.To.Add(to);

                            correo.Subject = Asunto;
                            correo.SubjectEncoding = System.Text.Encoding.UTF8;

                            correo.Body = Mensaje;
                            correo.BodyEncoding = System.Text.Encoding.UTF8;

                            correo.IsBodyHtml = false;

                            correo.Priority = MailPriority.High;

                            correo.Attachments.Add(new Attachment(RutaFileAttach));

                            //smtp.Credentials = new System.Net.NetworkCredential(correoRemitente, contraseña);
                            smtp.Port = 993;
                        smtp.Host = "mail.sima.com.pe";//"10.10.90.77";
                            smtp.EnableSsl = true;

                            smtp.Send(correo);
                        }
                        catch (System.IO.IOException)
                        {
                        // MessageBox.Show("No se encontró el archivo " + RutaFileAttach, "Envío de Correo", MessageBoxButtons.OK);
                        int i = 0;
                        }
                        catch (SmtpException ex)
                        {
                        int p = 0;
                            //MessageBox.Show(ex.Message, "Envío de Correo", MessageBoxButtons.OK);
                        }
                    
                }

            }

            public struct Pagina
            {
                public static void Call(string PathPagina)
                {
                    ((System.Web.UI.Page)HttpContext.Current.Handler).Response.Redirect(PathPagina);
                }
                public static string UrlContextActual()
                {
                    HttpRequest ContextRequest = ((System.Web.UI.Page)HttpContext.Current.Handler).Request;
                    //string NomAPP = ((System.Web.UI.Page)HttpContext.Current.Handler).Request.ApplicationPath.Replace("/", "");
                    string NomAPP = AppName();
                    string UrlActual = ContextRequest.Url.AbsoluteUri;
                    int PosIni = UrlActual.IndexOf(NomAPP) + 1;
                    UrlActual = HttpUtility.UrlDecode(UrlActual.Substring((PosIni + NomAPP.Length), (UrlActual.Length - (PosIni + NomAPP.Length))));
                    return UrlActual;
                }

                public static void WriteDataTableToXML(DataView dvSource)
                {
                    DataTable dtDestino = Data.ViewToDataTable(dvSource);
                    WriteDataTableToXML(dtDestino);
                }
                public static void WriteDataTableToXML(DataTable dtSource)
                {
                    DataSet ds = new DataSet();
                    try
                    {
                        DataTable dtc = dtSource.Copy();

                        ds.Tables.Add(dtc);
                        StringWriter sw = new StringWriter();
                        ds.WriteXml(sw, XmlWriteMode.IgnoreSchema);
                        string s = sw.ToString();
                        string attachment = "attachment; filename=test.xml";

                        HttpContext.Current.Response.ClearContent();
                        HttpContext.Current.Response.Clear();
                        HttpContext.Current.Response.ContentType = "text/xml";
                        HttpContext.Current.Response.AddHeader("content-disposition", attachment);
                        HttpContext.Current.Response.Write(s);
                        HttpContext.Current.Response.End();
                    }
                    catch (Exception ex)
                    {
                        string ss = ex.Message.ToString();
                    }

                }

