                static void TreeSubNodo(DataTable dtSource, string NameFieldPadre, string NameField, string ValorField, string IdNodo, int Nivel)
                {
                    int i = 1;
                    foreach (DataRow dr in dtSource.Select(NameFieldPadre + "='" + ValorField + "'"))
                    {
                        DataRow newRow = dtClon.NewRow();
                        newRow.ItemArray = dr.ItemArray;

                        newRow["IdNodo"] = ((Nivel == 1) ? i.ToString() : IdNodo + "." + i.ToString());
                        newRow["Nivel"] = Nivel;
                        dtClon.Rows.Add(newRow);

                        if (Convert.ToInt32(dr["NroHijos"]) > 0)
                        {
                            TreeSubNodo(dtSource, NameFieldPadre, NameField, newRow[NameField].ToString(), newRow["IdNodo"].ToString(), (Nivel + 1));
                        }
                        i++;
                    }
                }


