            {
                public static string Leer(string PathFile){
                    var file = new StreamReader(PathFile).ReadToEnd();
                    return file.ToString();
                }

                public static void Log(String Seccion, string Mensaje)
                {
                    string ArcModo = "DEBUG_";
#if (!DEBUG)
                            ArcModo="";
#endif
                    Generar(Configuracion.ArchivoLog + "LogIface_" + ArcModo + Helper.Funciones.GetFechaHoyFormatYYYYmmdd + ".txt", "HORA:" + Helper.Funciones.GetFechaHoraHoy + "SECCION:" + Seccion, Mensaje);
                }
                private static void Generar(string NombreArchivoLog, string Seccion, string Mensaje)
                {
                    try
                    {
                        //String LogFile = String.Format("{0}" + NombreArchivoLog, System.IO.Path.GetDirectoryName(System.Reflection.Assembly.GetExecutingAssembly().Location));
                        String LogFile = NombreArchivoLog;
                        if (LogFile != "")
                        {
                            String Message = "SECCION:=" + Seccion + Constantes.Caracteres.SeparadorHorizontal + Constantes.Caracteres.SignoInterrogacion + " MENSAJE:=" + Mensaje + Environment.NewLine;
                            byte[] binLogString = Encoding.Default.GetBytes(Message);
                            System.IO.FileStream logFile = new System.IO.FileStream(LogFile, System.IO.FileMode.OpenOrCreate, System.IO.FileAccess.Write, System.IO.FileShare.Write);
                            logFile.Seek(0, System.IO.SeekOrigin.End);
                            logFile.Write(binLogString, 0, binLogString.Length);
                            logFile.Close();
                        }
                    }
                    catch {; }

                }

                public static Byte[] ImgTobytBLOBData(string PathFileImg) {
                    try{ 
                    string[] Archivo = PathFileImg.Split('\\');
                    string pattern = "[^\\s]+(.*?)\\.(jpg|jpeg|png|gif|JPG|JPEG|PNG|GIF)$";
                    bool IsImagen = Regex.IsMatch(Archivo[Archivo.GetUpperBound(0)], pattern, RegexOptions.IgnoreCase);

                    if (IsImagen)
                    {
                        FileStream fsBLOBFile = new FileStream(PathFileImg, FileMode.Open, FileAccess.Read);
                        Byte[] bytBLOBDataFirma = new Byte[fsBLOBFile.Length];
                        fsBLOBFile.Read(bytBLOBDataFirma, 0, bytBLOBDataFirma.Length);
                        fsBLOBFile.Close();
                        return bytBLOBDataFirma;
                    }
                    return null;
                    }
                    catch(Exception){
                        int i = 0;

                    }
                    return null;
                }


                public struct UrlImagen{
                    public static string DownloadToFile(Uri UrlPathFileImg,string PathLocal ) {
                        string []arrPath = UrlPathFileImg.AbsolutePath.Split('/');
                        string PathFileLocal = PathLocal + "\\" +  arrPath[arrPath.GetUpperBound(0)].ToString();
                        try
                        {
                            using (var webClient = new WebClient())
                            {
                                if (File.Exists(PathFileLocal))
                                {
                                    File.Delete(PathFileLocal);
                                }
                                webClient.DownloadFile(UrlPathFileImg, PathFileLocal);
                            }
                        }
                        catch(Exception) {
                            PathFileLocal = "No existe img In Url";
                        }
                        return PathFileLocal;
                    }
                    public static string DownloadToUrlData(Uri UrlPathFileImg)
                    {
                        string ImgData = "";
                        try
                        {
                            using (var webClient = new WebClient())
                            {
                                byte[] imageBytes = webClient.DownloadData(UrlPathFileImg);
                                ImgData = "data:image/png;base64," + Convert.ToBase64String(imageBytes);
                            }
                        }
                        catch (Exception ex)
                        {
                            ImgData = EasyUtilitario.Constantes.ImgDataURL.ImgDefault; 
                        }
                        return ImgData;
                    }

                }

                public struct PDF { 
                    public static void CrearTemplateWatermark(string TextodeAgua, string PathFileLocal){
                        var document = new Document();
                        var pdfWriter = PdfWriter.GetInstance(document, new FileStream(PathFileLocal, FileMode.Create));
                        var font = new iTextSharp.text.Font(iTextSharp.text.Font.FontFamily.HELVETICA, 60, iTextSharp.text.Font.NORMAL, iTextSharp.text.BaseColor.LIGHT_GRAY);
                        document.Open();
                        ColumnText.ShowTextAligned(pdfWriter.DirectContent, iTextSharp.text.Element.ALIGN_CENTER, new Phrase(TextodeAgua, font), 300, 400, 45);
                        document.Close();
                    }
                    //public static void AddTextWatermark(string sourceFilePath, string watermarkTemplatePath, string targetFilePath, iTextSharp.text.Image image)
                    public static void AddTextWatermark(string SourceFilePathLocal, string watermarkTemplatePath)
                    {
                        string[] arrPath = SourceFilePathLocal.Split("\\".ToCharArray());
                        string[] NombreExt = arrPath[arrPath.GetUpperBound(0)].ToString().Split('.');
                        string Nombre = NombreExt[0];
                        arrPath = arrPath.Where(val => val != Nombre + "." + NombreExt[1]).ToArray();

                        string PathFileLocalClone = string.Join("\\", arrPath) + "\\" + Nombre + "MARK." + NombreExt[1].ToString();

                        var pdfReaderSource = new PdfReader(SourceFilePathLocal);
                        var pdfStamper = new PdfStamper(pdfReaderSource, new FileStream(PathFileLocalClone, FileMode.Create));
                        var pdfReaderTemplate = new PdfReader(watermarkTemplatePath);
                        var page = pdfStamper.GetImportedPage(pdfReaderTemplate, 1);

                        for (var i = 0; i < pdfReaderSource.NumberOfPages; i++)
                        {
                            var content = pdfStamper.GetUnderContent(i + 1);
                            content.AddTemplate(page, 0, 0);
                        }

                        pdfStamper.Close();
                        pdfReaderTemplate.Close();
                        pdfReaderSource.Close();
                        //Elimina
                        File.Delete(SourceFilePathLocal);
                        //Renombra
                        System.IO.File.Move(PathFileLocalClone, SourceFilePathLocal);
                    }
                    public static void AddImageWatermark(string SourceFilePathLocal,  iTextSharp.text.Image image)
                    {
                        string[] arrPath = SourceFilePathLocal.Split("\\".ToCharArray());
                        string[] NombreExt = arrPath[arrPath.GetUpperBound(0)].ToString().Split('.');
